import httpClient from "@/utils/httpclient";
import model from "@/components/model";
export default {
  name: "addVehicle",
  components: {
    model: model
  },
  data: function data() {
    return {
      title: '',
      content: '',
      show: false,
      showB: true,
      vin: '',
      vinIsVaild: false,
      vinSuccess: false,
      data: {},
      year: '',
      make: '',
      trim: '',
      engine: '',
      price: '',
      stock: '',
      condition: 'new',
      odometer: '',
      model: '',
      color: 'Black',
      date: '',
      plate: '',
      photo: ''
    };
  },
  mounted: function mounted() {},
  watch: {
    vin: function vin(curVal) {
      var _this = this;

      if (curVal.length == 17) {
        httpClient.get('/api/v1/vehicle/detail/vin?vin=' + this.vin).then(function (response) {
          _this.vinIsVaild = false;
          _this.vinSuccess = true;
          _this.showB = false;
          _this.data = response.data.data;
          _this.year = _this.data.year;
          _this.make = _this.data.make;
          _this.model = _this.data.model;
          _this.trim = _this.data.trim;
          _this.engine = _this.data.engineType;
          _this.price = _this.data.price;
          _this.color = _this.data.color;
          _this.date = _this.data.inventoryDays;
          _this.stock = _this.data.stockNumber;
          _this.condition = _this.data.vehicleType;
          _this.odometer = _this.data.currentMileage / 1609.344;
          _this.plate = _this.data.plate;
          _this.photo = _this.data.photoPath;
        }).catch(function (error) {
          _this.vinIsVaild = false;
          _this.vinSuccess = true;
          _this.showB = false;
        });
      } else {
        this.vinIsVaild = true;
      }
    }
  },
  methods: {
    closeTip: function closeTip() {
      this.show = false;
    },
    savefile: function savefile(event) {
      var _this2 = this;

      var file = event.target.files;
      var fb = new FormData();
      fb.append("image", file[0]);
      httpClient.post('/api/v1/user/updateAvatar', fb).then(function (response) {
        if (response.data.code == 200) {
          _this2.photo = response.data.data.avatarUrl;
          _this2.title = "Success";
          _this2.content = "Photo Uploaded Successfully";
          _this2.show = true;
          _this2.showB = false;
        }
      }).catch(function (error) {
        console.error(error);
      });
    },
    saveData: function saveData() {
      var _this3 = this;

      httpClient.post('/api/v1/vehicle/insert/vehicle', {
        vin: this.vin,
        year: this.year,
        make: this.make,
        model: this.model,
        trim: this.trim,
        engineType: this.engine,
        color: this.color,
        price: this.price,
        stockNumber: this.stock,
        inventoryDate: new Date(this.date).getTime(),
        vehicleType: this.confidence,
        currentMileage: this.odometer,
        plate: this.plate,
        photoPath: this.photo
      }).then(function (response) {
        if (response.data.data.bindResult == true) {
          _this3.$router.push('/vehicle/detail/' + response.data.data.vehicleId);
        }
      });
    }
  }
};
